import "./ItemClicked.css";
export default function ItemClicked({ item }) {
  return (
    <>
      <div className="item-detail">
        <h2>{item.title}</h2>
        <img src={item.image} alt={item.title} />
        <p>Price: {item.price}</p>
        <p>Category: {item.category}</p>
        <p>Description: {item.description}</p>
      </div>
    </>
  );
}
